const t="Գլխավոր Էջ",c="ծառայություններ",o="Կապ մեզ հետ",n="Դրամապանակ։ Մեկը բոլորի համար",s="մասնագիտացած է ծրագրային ապահովման մշակման, խորհրդատվության և լուծումների մեջ բանկերի, վճարային համակարգերի և գործակալների համար ֆինանսական ծառայությունների, բլոկչեյն տեխնոլոգիաների և կրիպտոարժույթների ոլորտում:",e="Սարքավորումների և ծրագրային ապահովման բլոկչեյն լուծումների մշակում. բաշխված ռեգիստրներ, խելացի պայմանագրեր, թվային ֆինանսական ակտիվների համար նշանավորում, պահպանման և փոխանցման ծառայություններ, փոխանակում, փոխանակում և վերլուծական հարթակներ, բանկոմատներ, մայնինգ:",a="Պ2Պ գործարքներ բլոկչեյն գործարքային գրաֆիկի շարժման միջոցով։",i="Մուլտիվալյար դրամապանակ։ Անվտանգությունը առավել ուշ։ Գծագրությունների երեք տարբերակները, որպեսզի կարողանաք ընտրել լավագույնը՝ օնլայն, սառեցված և անլար:",l="Կրիպտովալյարների աշխարհում համալիր ուղղաթիռ: Դասեր տարբեր բաժիններում՝ սկսած սկզբունքներից մինչև պրոֆեսիոնալներ:",r="Սթեյքինգ: Կրիպտովալյարներից պասիվ եկավորություն ստանալու համար կարող եք օգտվել սթեյքինգի ֆունկցիան։",p="Լրացրեք ֆորման և մենք կկապնվենք ձեզ հետ",m="Ուղարկել",u="Կապվեք մեզ հետ սոցիալական ցանցերում",k={home:t,services:c,contactUs:o,walletForEveryone:n,specialization:s,blockChainDevelopment:e,p2p:a,multiCurrency:i,study:l,staking:r,contactBack:p,send:m,socialContact:u};export{e as blockChainDevelopment,p as contactBack,o as contactUs,k as default,t as home,i as multiCurrency,a as p2p,m as send,c as services,u as socialContact,s as specialization,r as staking,l as study,n as walletForEveryone};
